import axios from "axios";



const updateUser = async (
  userId,
  username,
  from,
  city,
  relationship,
  profilePicture,
  coverPicture,

) => {

  try {
    await axios.put("http://localhost:8800/users/update", {
      userId,
      username,
      from,
      city,
      relationship,
      profilePicture,
      coverPicture,
    });
  } catch (error) {
    console.log(error);
  }
};

export { updateUser };
